        "title": "Handmade Map Art Prints",
        "announcement": "Welcome to CartoCreative! A shop where creativity and graphic design meet a burning passion for cartography.\r\n\r\nMake your map look the way you want. CartoCreative maps are customizable! You choose the size and color. Send a personalized gift by changing the wording, placing a heart over your home and more.\r\n\r\nWe do not use a computer program to generate our maps, all of our prints are uniquely handmade and carefully packaged for delivery.\r\n\r\nAll items are shipped via Canada Post.\r\nStandard shipping does not include a tracking number. \r\nIf you need your order by a specific date, please allow time for delivery.\r\n\r\nStandard shipping time estimates:\r\nCanada - 4-10 business days (mon-fri, not including holidays)\r\nUSA - 6-12 business days (mon-fri, not including holidays)\r\nInternational 7-14 business days (or 4-6 weeks for packages over 20&quot;x28&quot;)\r\n\r\nIf you require delivery before the shipping estimates, please purchase a shipping upgrade: \r\nhttps:\/\/www.etsy.com\/ca\/listing\/172216438\/express-shipping-upgrade \r\n\r\nYou can find us on social media too:\r\nWebsite: http:\/\/www.cartocreative.com\r\nFacebook: https:\/\/www.facebook.com\/CartoCreative\r\nTwitter: https:\/\/twitter.com\/CartoCreative\r\nEtsy Wholesale\r\n\r\nWe happily accept wholesale inquiries.",
        "currency_code": "USD",
        "is_vacation": false,
        "vacation_message": null,
        "sale_message": "Thank you for your purchase from CartoCreative!\r\n\r\nYour satisfaction is very important to us. Please contact us with and questions or concerns. If you are happy with your order, you can share your experience with others by leaving feedback: http:\/\/www.etsy.com\/feedback\/awaiting \r\n\r\nItems ship within 1-3 business days via Canada Post. Please ensure the shipping address listed in your Etsy account is correct. Shipping time within Canada and the US is estimated at 4-12 business days (Monday-Friday, not including weekends and holidays) and 1-6 weeks for international destinations. \r\n\r\nIf you require express shipping or a tracking number, please purchase an express shipping upgrade and be sure to note your order number:\r\nhttp:\/\/www.etsy.com\/listing\/172216438\/express-shipping-upgrade-tracking-number \r\n\r\nAll the best,\r\nMel & Steve\r\nCartoCreative\r\n",
        "digital_sale_message": "Thank you for your purchase from CartoCreative!\r\n\r\nYour satisfaction is very important to us. Please contact us with and questions or concerns. If you are happy with your order, you can share your experience with others by leaving feedback: http:\/\/www.etsy.com\/feedback\/awaiting \r\n\r\nAll the best,\r\nMel & Steve\r\nCartoCreative",
        "last_updated_tsz": 1422042830,
