        "login_name": "CartoCreative",
        "accepts_custom_requests": false,
        "policy_welcome": "Welcome to CartoCreative! A shop where creativity and graphic design meet a burning passion for cartography.\r\n\r\nMake your map look the way you want. CartoCreative maps are customizable! You choose the size and color. Send a personalized gift by changing the wording, placing a heart over your home and more.\r\n\r\nWe do not use a computer program to generate our maps, all of our prints are uniquely handmade and carefully packaged for delivery.\r\n\r\nAll items are shipped via Canada Post.\r\nStandard shipping does not include a tracking number. \r\nIf you need your order by a specific date, please allow time for delivery.\r\n\r\nStandard shipping time estimates:\r\nCanada - 4-10 business days (mon-fri, not including holidays)\r\nUSA - 6-12 business days (mon-fri, not including holidays)\r\nInternational 7-14 business days (or 4-6 weeks for packages over 20&quot;x28&quot;)\r\n\r\nIf you require delivery before the shipping estimates, please purchase a shipping upgrade: \r\nhttps:\/\/www.etsy.com\/ca\/listing\/172216438\/express-shipping-upgrade \r\n\r\nYou can find us on social media too:\r\nWebsite: http:\/\/www.cartocreative.com\r\nFacebook: https:\/\/www.facebook.com\/CartoCreative\r\nTwitter: https:\/\/twitter.com\/CartoCreative\r\nEtsy Wholesale\r\n\r\nWe happily accept wholesale inquiries.",
        "policy_payment": "We accept payments via PayPal, Mastercard, Visa, American Express, Discover Card, and Etsy Gift Cards.",
        "policy_shipping": "CartoCreative is happy to ship worldwide!\r\n\r\nSHIPPING\r\n*Standard shipping does not include a tracking number.* \r\nItems are shipped via Canada Post. \r\n\r\nSTANDARD SHIPPING TIME ESTIMATES\r\nCanada \u2013 estimated 4-10 business days (Monday to Friday, not including weekends and holidays)\r\nUSA - estimated 6-12 business days (Monday to Friday, not including weekends and holidays)\r\nInternational \u2013 estimated 7-14 business days for packages up to 20&quot; x 28&quot;\r\nUnfortunately sizes over 20&quot;x28&quot; must be sent by boat and are estimated to take 4-10 weeks to arrive, unless an express shipping upgrade is purchased\r\nCanada Post does not guarantee delivery dates, these are estimates only.\r\n** INTERNATIONAL ORDERS may take longer due to customs delays**\r\n\r\nIf you have not received your package within the expected time frames, please send us a message.\r\n\r\nProcessing time is an additional 1-3 business days (or as stated). We try our best to get all orders out as quickly as possible.\r\n\r\nPlease allow time for your package to arrive. If you require delivery before the shipping estimates, please purchase a shipping upgrade: \r\nhttps:\/\/www.etsy.com\/ca\/listing\/172216438\/express-shipping-upgrade\r\n\r\nAsking us to rush your order, hurry up, or work harder will not speed up the delivery time.\r\n\r\nHOW ARE PRINTS SHIPPED?\r\n8&quot;x10&quot; prints are shipped in sturdy cardboard mailers via Oversize Lettermail within Canada and sometimes the US and via Light Packet or Small Packet to international destinations.\r\n\r\n11&quot;x14&quot; and 12&quot;x16&quot; prints are shipped flat via Canada Post - Small Packet Air Mail for US and international destinations and Canada Post Expedited Mail within Canada.\r\n\r\n14&quot;x18&quot; - 20&quot;x 28&quot; prints and larger are shipped rolled in double thick mailing tubes and are sent via Canada Post - Small Packet Air Mail for US and international destinations and via Canada Post Expedited Mail within Canada.\r\n\r\n24&quot;x30&quot; prints and larger are shipped rolled in a double thick mailing tube and are sent via Canada Post - Expedited within Canada and the US and International Surface Mail for most international destinations (unfortunately due to the size of the package larger international packages have to be sent via boat and can take 4-6 weeks to arrive without a shipping upgrade).\r\n\r\nCUSTOMS\r\n*International buyers are responsible for any customs fees and taxes.*\r\nPlease be aware of any VATs, tarrifs and taxes charged by the your country. These are not fees added on by us, but are the taxes and fees required of the buyer by the receiving country. \r\n\r\nWe are not able to gift wrap shipments as customs must be able to open packages, but we are happy to include a gift note (just leave us a message in note to seller during checkout).\r\n\r\nIt is illegal to falsify customs documents (mark as gifts, lower price, etc). Please do not ask us to commit a crime.\r\n\r\nSHIPPING ADDRESS\r\n*Please verify your shipping address during checkout.*\r\nWe want to make sure you receive your package :)\r\n\r\nEXPRESS\/TRACKING\r\nNeed your order sooner or want a tracking number? Select the applicable express shipping upgrade during checkout or add this upgrade to your order:\r\nhttps:\/\/www.etsy.com\/ca\/listing\/172216438\/express-shipping-upgrade\r\n\r\nShipping upgrades must be purchased BEFORE the item is shipped. We are not able to upgrade your shipping if the package has already been shipped.\r\n\r\nWHERE IS MY TRACKING NUMBER?\r\n**Standard shipping does not include a tracking number.** \r\nCanada Post only provides useable tracking numbers for upgraded shipping services.\r\n\r\nIf you require a tracking number, please purchase a shipping upgrade before your item ships: https:\/\/www.etsy.com\/ca\/listing\/172216438\/express-shipping-upgrade \r\n\r\nAlthough most shipping labels will include a bar code, this code is not scanned once the package leaves Canada unless an upgraded shipping service is purchased. For standard shipments, the bar code is used by Canada Post for reference if there is a problem with shipment, but does not get updated regularly. \r\n\r\nLOST IN THE MAIL?\r\nIf you have not received your package within 20 business days from shipment (Canada\/USA) and 35 days (International), we will send you a replacement at no extra cost.\r\n\r\nDAMAGED ITEMS\r\nWe take a great deal of care to ensure that all goods are packaged securely and leave us in perfect condition. If your item arrives damaged, please send us a message with a photo of the damage and we will send a replacement at no extra cost.",
        "policy_refunds": "If you are in any way unsatisfied with your shipment from CartoCreative, please send us a message on Etsy or to contact@cartocreative.com. Your satisfaction is very important to us. \r\n\r\nWe are unable to accept items returned without prior approval and will not be held accountable for any return shipping fees.",
