        "announcement": "OLD MAPS AND PRINTS REPRODUCTIONS, vintage posters, travel posters\r\n\r\nWe  sell very high quality prints of antique maps and posters . They were restored to seek their original shine.\r\n\r\n\r\nfacebook: http:\/\/www.facebook.com\/OldCityPrints\r\n\r\nPlease read the shop policies for important informations.\r\n\r\nAll the original maps were carefully restored digitally to provide high quality prints.\r\nAll the maps are believed to be in the public domain so any particular doubt regarding copyright just let us know.\r\n____________________________________________________________________\r\nIf you are dissatisfied with your purchase for any reason, please contact me. Customer satisfaction is very important and I answer any questions or concerns. Please don\u2019t forget to leave feedback!\r\nThanks for the visit. ",
