        "announcement": "Travel maps, nursery art, kids wall art, long distance relationship gifts, personalized usa maps, world maps, custom love maps, custom quotes, baby nursery decor, typography.\r\n\r\n&gt;&gt;&gt; SHIPPING\/PROOFING TIMELINE &gt;&gt;&gt; \r\nNon-custom, non-personalized -- Shipped out within one week\r\nCustom colors, wording, design, personalized -- Proof sent or shipped out within two weeks\r\nNon-paper items: 3 to 4 weeks\r\n\r\n&gt;&gt;&gt; CUSTOM PROOFS &gt;&gt;&gt; \r\nProof sent via Etsy Conversation (on-site inbox) within two weeks, and shipped out within 3 business days after approval.\r\n\r\n*** Orders placed on weekends are considered received on Monday.\r\n&quot;Business days&quot; are Monday through Friday. Weekends and U.S. holidays are not included in proofing or shipping time frame. \r\n\r\n&gt;&gt;&gt; MOCK-UPS BEFORE PURCHASE &gt;&gt;&gt; \r\nI do not do custom work of any kind before a purchase has been made, but I am happy to send you similar examples before purchase, and a proof before I print and ship.\r\n\r\n&gt;&gt;&gt; QUICK LINKS &gt;&gt;&gt; \r\nNURSERY ART\r\nhttps:\/\/www.etsy.com\/shop\/PaperPlanePrints\/search?search_query=nursery\r\nDIY PIN OR STICKER TRAVEL MAPS:\r\nhttps:\/\/www.etsy.com\/shop\/PaperPlanePrints?section_id=15995980\r\nLOVE STORY MAPS:\r\nhttps:\/\/www.etsy.com\/shop\/PaperPlanePrints?section_id=12103639\r\nALL WORLD MAPS:\r\nhttp:\/\/www.etsy.com\/shop\/paperplaneprints\/search?search_query=world+map\r\nALL USA MAPS:\r\nhttp:\/\/www.etsy.com\/shop\/paperplaneprints\/search?search_query=usa+map\r\nALL MAPS:\r\nhttp:\/\/www.etsy.com\/shop\/paperplaneprints\/search?search_query=map\r\n\r\n\r\nFACEBOOK: http:\/\/www.facebook.com\/PaperPlanePrints\r\nTWITTER: http:\/\/twitter.com\/ShopPaperPlane\r\nEMAIL DISCOUNTS: http:\/\/eepurl.com\/t7INP\r\n\r\n~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~*~**~*~*~*~*~*~*\r\nThank you so much for visiting my shop. Please CONTACT ME if you have any questions or comments. I try to respond the same day, but please allow 24 hours (excluding weekends) for a response.",
        "currency_code": "USD",
        "is_vacation": false,
        "vacation_message": "USA and world travel maps, pin maps, long distance relationship maps, personalized gifts, nursery art, kids wall art, baby nursery decor, custom art prints\r\n\r\n*** On vacation until January 5, 2015 ***\r\n2014 was AMAZING! I&#39;m taking some much needed vacation time, so the shop is closed. But I will try to respond to messages when I have Internet access. \r\n\r\nWHERE&#39;S MY ORDER??\r\nAll orders have been shipped out within the time frames promised in the item listing or shipping and policies page. Please check your email for the shipping confirmation that was sent from Etsy. It has your tracking information.\r\n\r\nMY TRACKING INFO IS NOT UPDATED?!\r\nThe Post Office does not scan and update all packages consistently. Rest assured that I have absolutely shipped your order out, even if the tracking info only says &quot;shipping label created.&quot;  You can try contacting the US Post Office at 1-800-275-8777 with your tracking number to get more info, but they may not be able to offer more than what is shown online.\r\n\r\nSO WHEN WILL IT GET HERE?\r\nUnfortunately I can&#39;t guarantee a delivery date. USA packages may take a week or more at this time of year. International packages may take several weeks.\r\n\r\nI HAVE A DIFFERENT QUESTION\r\nSend me a message:  http:\/\/www.etsy.com\/conversations\/new?with_id=5061031\r\n\r\nThank you and happy holidays!\r\n\r\n--------------------------------------\r\nCheck my sold listings to see what I sell: http:\/\/www.etsy.com\/shop\/paperplaneprints\/sold  (then scroll down)",
        "sale_message": "I humbly THANK YOU for your purchase. Come back anytime! Use this discount code or pass it along to friends and family: \r\nWELCOMEBACK10\r\n\r\n&gt;&gt; 1 TO 2 WEEK SHIPPING\/PROOFING TIMELINE &gt;&gt; \r\n*** Orders placed on weekends are considered received on Monday.\r\nNON-CUSTOM PRINTS: No color or design changes that require a proof to be sent. Shipped out within one week of payment.\r\nCUSTOM COLOR\/DESIGN PRINTS: Proof sent via Etsy Conversation (on-site inbox) within two weeks, and shipped out within 3 business days after approval.\r\nNON-PAPER ITEMS: Shipped in 3 to 4 weeks\r\n\r\nSHIPPING DELAYS\r\nI cannot guarantee the the Post Office will deliver on time. Packages are sometimes delayed once I&#39;ve put them in the mail; this is out of my control. Design and shipping fees will not be refunded if the Post Office is delayed.\r\n\r\nCONTACT ME\r\nPlease make sure you have read the listing description thoroughly, and feel free to send me a message if you missed something. Etsy &quot;Conversation&quot; is the fastest way to reach me; external emails, Facebook, etc. are checked less frequently.\r\n\r\nFEEDBACK\/REVIEWS\r\nIt makes my day to know that you are happy with your purchase. If you like it or love it, take a minute to let me know. You can give me Etsy feedback here: \r\nhttp:\/\/www.etsy.com\/feedback\/awaiting\r\nor simply send me an email or Etsy conversation message.  \r\n\r\nCONNECT WITH ME with me for coupons, flash sales, and inspiration.\r\nFACEBOOK: http:\/\/www.facebook.com\/PaperPlanePrints\r\nTWITTER: http:\/\/twitter.com\/ShopPaperPlane\r\nEMAIL LIST: http:\/\/eepurl.com\/t7INP",
